import React, { useState } from 'react';

function App() {
  const [result, setResult] = useState(null);

  const detectLive = async () => {
    const response = await fetch("http://localhost:8000/api/v1/detect-live");
    const data = await response.json();
    setResult(data);
  };

  return (
    <div style={{ padding: "2rem", fontFamily: "Arial" }}>
      <h1>YOLO Student Counter</h1>
      <button onClick={detectLive}>Detect Live from Camera</button>
      {result && (
        <div style={{ marginTop: "1rem" }}>
          <h2>Detected: {result.count} people</h2>
          <pre>{JSON.stringify(result.boxes, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
